import React from "react";
import Navbar from "../Components/Navbar";

export default function AboutPage() {
  return (
    <>
      <div className="bg-black fixed  block h-36 w-full md:h-20">
        <Navbar />
      </div>
      {/* index header section  */}
      <section className=" min-h-[80vh] IndexHeaderBackground flex">
        <div className="m-auto text-center">
          <h2 className="text-gray-400 mb-3 md:text-5xl text-4xl">
            Hi, This Side Mohit
          </h2>
          <div className="">
            <h3 className="text-gray-300 md:text-[7rem] text-6xl font-bold md:leading-[5.8rem] font-mono francois-one-regular">
              Full Stack Web Developer
            </h3>
          </div>
          
        </div>
      </section>
    </>
  );
}
